import React from "react";

function Profile() {
  return (
    <div id="body">
      <div id="body-sub">
        <p id="big-font">Profile</p>
      </div>
    </div>
  );
}

function Image() {
  return (
    <div id="image">
      playground ver
      <br />
      <img
        src="https://storage.googleapis.com/pai-images/1140c9aeeca0410d9644b599aa8bae29.jpeg"
        width="30%"
      />
      <img
        src="https://storage.googleapis.com/pai-images/04e7113e04894d489370a4e59f8435b7.jpeg"
        width="30%"
      />
      <img
        src="https://storage.googleapis.com/pai-images/19072de812df4af8817c8dd8c0e284a2.jpeg"
        width="30%"
      />
      <img
        src="https://storage.googleapis.com/pai-images/e6a3c25ffb2443c38e59d4e94b645d11.jpeg"
        width="30%"
      />
      <img
        src="https://storage.googleapis.com/pai-images/812d09f575dc4ee6b68bbbca5d8e4649.jpeg"
        width="30%"
      />
      <br />
    </div>
  );
}

export default Profile;
